   "source": [
    "barplot(table(df$Family_Size, df$Housing_Type), col = c(\"lightblue\", \"green\"),\n",
    "        main = \"Distribution of Families by Family Size and Address Type\",\n",
    "        xlab = \"Family Size\", ylab = \"Frequency\", ylim = c(0, 500))\n",
    "\n",
    "legend(\"topleft\", inset = 0.1, legend = levels(df$Family_Size), fill = c(\"lightblue\", \"green\"), lty=1:4, cex= 1.3, bty = \"n\")\n",
    "\n",
    "cat(\" As we can see, most families are made up of more than 3 people and in general families live mainly in urban areas compared to rural areas.\")\n",
    "\n",
    "\n",
    "\n",
    "# What is the average level of education of the parents?\n",
    "df_long <- gather(df, key = \"Parent\", value = \"Education\", Mother_Education, Father_Education)\n",
    "\n",
    "# Order education levels in ascending order\n",
    "df_long$Education <- factor(df_long$Education, levels = c('None', 'Primary School','Lower Secondary School','High School','Higher Education'))\n",
    "\n",
    "ggplot(df_long, aes(x = Education, fill = Parent)) +\n",
    "  geom_bar(position = \"dodge\", color = \"white\") +\n",
    "  labs(title = \"Distribution of Mother and Father Education Levels\",\n",
    "       x = \"Education Level\",\n",
    "       y = \"Frequency\") +\n",
    "  scale_fill_manual(values = c(\"Mother_Education\" = \"lightblue\", \"Father_Education\" = \"lightgreen\"))\n",
    "\n",
    "cat(\" As can be seen, the educational level of parents is very varied even if the majority of parents (32.2% of fathers and 28.6% of mothers) stopped at lower secondary school.\")"
   ]
  },
