   "source": [
    "Alcoholism levels are significantly higher among students dedicating up to 2 hours to study during the week. Additionally, students who engage in more extensive study sessions, specifically those studying for more than 10 hours, exhibit higher levels of alcohol consumption compared to their counterparts studying between 5 to 10 hours. \n",
    " \n",
    " Interestingly, students who allocate their time to study between 2 to 5 hours per week demonstrate the lowest levels of alcoholism."
   ]
