   "source": [
    "\n",
    "The alcohol consumption between age and during weekdays or weekends has slightly correlated. The primary alcohol consumption occurs among 16-18-year-old students. Most of them consume alcoholic beverages very minimally on weekdays, with 17-18-year-old students showing higher levels, especially high or very high. \n",
    "\n",
    "However, during weekends, alcohol consumption is nearly equal across all age groups. Additionally, 20-22-year-old students tend to have very high alcohol consumption on weekdays."
   ]
