   "source": [
    "In the graph below, we examine the potential impact of alcohol consumption on students' school absences. The data suggests a correlation between drinking habits and truancy.\n",
    "\n",
    "Moderate, low, and even very low levels of alcohol consumption appear to contribute to higher school absences, exceeding 10 days in a semester.\n",
    "Notably, 17-year-old students who consume alcohol at a low level during weekdays exhibit the highest number of school days missed.\n",
    "\n",
    "During weekends, there is an observable increase in alcohol consumption across all levels, with students consuming more than on weekdays. \n",
    "The majority tend to drink at an average level, which coincides with an increased rate of school absences compared to weekdays."
   ]
