   "source": [
    "The family relationship may increase alcohol consumption. But in the below graph, many students, who have good family relationship, drink more than poor family relationship students.\n",
    "\n",
    "Also, during the weekends alcoholism significantly increased among good and even better family relationship students. This unexpected observation prompts the conclusion that  there is a correlation between family background and alcoholism among students. This association becomes more evident during weekends, where the majority of students spend time at home."
