    "df1 <- scale(df_encoded)\n",
    "\n",
    "vars <- c(colnames(df1))\n",
    "Outliers <- c()\n",
    "for(i in vars){\n",
    "  max <- quantile(df1[,i], 0.75) + (IQR(df1[,i]) * 1.5 )\n",
    "  min <- quantile(df1[,i], 0.25) - (IQR(df1[,i]) * 1.5 )\n",
    "  idx <- which(df1[,i] < min | df1[,i] > max)\n",
    "  print(paste(i, length(idx), sep=' ')) # printing variable and number of potential outliers \n",
    "  Outliers <- c(Outliers, idx) \n",
    "}"
   ]
