    "# Assuming 'df' is your dataset\n",
    "library(cluster)\n",
    "\n",
    "# Hierarchical clustering\n",
    "hc <- hclust(dist(df_h1), method = \"complete\")\n",
    "\n",
    "# Plot the dendrogram\n",
    "plot(hc, main = \"Dendrogram of the Data\")\n"
   ]
